import React, { useEffect, useState } from 'react';
import styled from 'styled-components';
import { useNavigate } from 'react-router-dom'; 
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faUser as regularUser } from '@fortawesome/free-regular-svg-icons'; 
import { faHeart as regularHeart } from '@fortawesome/free-regular-svg-icons'; 
import { faHeart } from '@fortawesome/free-solid-svg-icons';
import axios from 'axios';

const Section2 = ({ projects, onLikeClick }) => {
  const navigate = useNavigate();

  const handleProjectClick = (project) => {
    const modifiedPk = project.pk.replace('#', '');
    navigate(`/ApplyPage/${modifiedPk}`);
  };

  return (
    <SectionWrapper>
      <SectionTitle>프로젝트 목록</SectionTitle>
      <ProjectList>
        {projects.map((project, index) => (
          <ProjectCard key={index} onClick={() => handleProjectClick(project)}>
            <ProjectOwner>
              <FontAwesomeIcon icon={regularUser} style={{ fontSize: '20px', lineHeight: '1.2', marginRight: '6px' }} />
              {project.creatorID}
            </ProjectOwner>
            <ProjectLikes onClick={(e) => { e.stopPropagation(); onLikeClick(index); }}>
              <FontAwesomeIcon icon={project.liked ? faHeart : regularHeart} style={{ color: project.liked ? 'red' : 'white', marginRight: '4px' }} />
              {project.likesCount}
            </ProjectLikes>
            <ProjectTitle>{project.title}</ProjectTitle>
            <Content>
              {project.content.length > 400 ? `${project.content.slice(0, 350)}...` : project.content}
            </Content>
            <ProjectInfo>
              <Tags>
                {project.tags.map((tag, tagIndex) => (
                  <Tag key={tagIndex}>{tag}</Tag>
                ))}
              </Tags>
              <Details>
                모집인원 | {project.recruitmentNum}명
              </Details>
              <Details>
                마감일 | {new Date(project.deadline).toLocaleDateString()}
              </Details>
            </ProjectInfo>
            <ApplyButton onClick={() => handleProjectClick(project)}>신청하기</ApplyButton>
          </ProjectCard>
        ))}
      </ProjectList>
      <Pagination>
        {/* Pagination logic can be added here if needed */}
      </Pagination>
    </SectionWrapper>
  );
};

const SectionWrapper = styled.div`
  display: flex;
  flex-direction: column;
  width: 100%;
  margin-top: 50px;
  margin-bottom: 40px;
`;

const SectionTitle = styled.h2`
  font-size: 24px;
  margin-top: 20px;
  margin-bottom: 20px;
`;

const ProjectList = styled.div`
  display: flex;
  flex-direction: column;
  max-height: 170vh; /* Optional */
`;

const ProjectCard = styled.div`
  position: relative;
  border: 2px solid #A0DAFB;
  border-radius: 30px;
  padding: 15px;
  margin: 20px 0;
  box-shadow: 0 2px 5px rgba(0, 0, 0, 0.1);
  background-color: white;
  cursor: pointer;

  &:hover {
    background-color: #A0DAFB;
  }
`;

const ProjectOwner = styled.div`
  font-weight: bold;
  color: #858585;
`;

const ProjectLikes = styled.div`
  position: absolute;
  border: 1px solid #ddd;
  border-radius: 15px;
  padding: 2px 8px;
  color: white;
  font-weight: bold;
  background-color: #C4C4C4;
  right: 10%;
  top: 4%;
  cursor: pointer;

  &:hover {
    background-color: #A0DAFB; 
  }
`;

const ProjectTitle = styled.h3`
  font-size: 20px;
  margin: 20px 0;
`;

const Content = styled.div`
  font-size: 16px;
  margin: 10px 0;
  min-height: 50px;
  max-height: 200px;
  overflow: hidden;
  color: #858585;
`;

const ProjectInfo = styled.div`
  font-size: 14px;
  color: #777;
`;

const Tags = styled.div`
  display: flex;
  margin-bottom: 5px;
`;

const Tag = styled.div`
  margin-right: 5px;
  border: 1px solid #ddd;
  border-radius: 14px;
  padding: 5px 10px;
  background-color: white;
  color: #0A8ED9;
`;

const Details = styled.div`
  text-align: left;
  margin-bottom: 5px;
`;

const ApplyButton = styled.button`
  margin-top: 5px;
  border: 1px solid #ddd;
  border-radius: 15px;
  padding: 8px;
  width: 100%;
  background-color: #62B9EC;
  color: white;
  font-weight: bold;
  cursor: pointer;

  &:hover {
    background-color: #A0DAFB;
  }
`;

const Pagination = styled.div`
  display: flex;
  justify-content: center;
  margin-top: 20px;
`;

const PageNumber = styled.button`
  margin: 0 5px;
  cursor: pointer;
`;

export default Section2;
